(12, 'enabled', 'power_on', 'Base', '<div class="preview">Address</div>\n                    <div class="view">\n                      <address contenteditable="true">\n                        <strong>Twitter, Inc.</strong><br>\n                        795 Folsom Ave, Suite 600<br>\n                        San Francisco, CA 94107<br>\n                        <abbr title="Phone">P:</abbr> (123) 456-7890\n                      </address>\n                    </div>', 'Jules Warner', 'Address', NULL, 'wi_Address'),
(13, 'enabled', 'power_on', 'Base', '<div class="preview">Blockquote</div>\n                    <div class="view clearfix">\n                      <blockquote contenteditable="true">\n                        <p>Add your own quote</p>\n                        <small>Someone<cite title="Source Title"> famous Source Title</cite></small>\n                      </blockquote>\n                    </div>', 'Jules Warner', 'Blockquotes', NULL, 'wi_Blockquotes'),
(14, 'enabled', 'power_on', 'Base', '<div class="preview">Unordered List</div>\n                    <div class="view">\n                      <ul contenteditable="true">\n                        <li>Lorem ipsum dolor sit amet</li>\n                        <li>Consectetur adipiscing elit</li>\n                        <li>Integer molestie lorem at massa</li>\n                        <li>Facilisis in pretium nisl aliquet</li>\n                        <li>Nulla volutpat aliquam velit</li>\n                        <li>Faucibus porta lacus fringilla vel</li>\n                        <li>Aenean sit amet erat nunc</li>\n                        <li>Eget porttitor lorem</li>\n                      </ul>\n                    </div>', 'Jules Warner', 'Unordered List', NULL, 'wi_Unordered List'),
(15, 'enabled', 'power_on', 'Base', '<div class="preview">Ordered List</div>\n                    <div class="view">\n                      <ol contenteditable="true">\n                        <li>Lorem ipsum dolor sit amet</li>\n                        <li>Consectetur adipiscing elit</li>\n                        <li>Integer molestie lorem at massa</li>\n                        <li>Facilisis in pretium nisl aliquet</li>\n                        <li>Nulla volutpat aliquam velit</li>\n                        <li>Faucibus porta lacus fringilla vel</li>\n                        <li>Aenean sit amet erat nunc</li>\n                        <li>Eget porttitor lorem</li>\n                      </ol>\n                    </div>', 'Jules Warner', 'Ordered List', NULL, 'wi_Ordered List'),
(16, 'enabled', 'power_on', 'Base', '<div class="preview">Description</div>\n                    <div class="view">\n                      <dl contenteditable="true">\n                        <dt>Rolex</dt>\n                        <dd>A description list is perfect for defining terms.</dd>\n                        <dt>Euismod</dt>\n                        <dd>Vestibulum id ligula porta felis euismod semper eget lacinia odio sem nec elit.</dd>\n                        <dd>Donec id elit non mi porta gravida at eget metus.</dd>\n                        <dt>Malesuada porta</dt>\n                        <dd>Etiam porta sem malesuada magna mollis euismod.</dd>\n                        <dt>Felis euismod semper eget lacinia</dt>\n                        <dd>Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</dd>\n                      </dl>\n                    </div>', 'Jules Warner', 'Description', NULL, 'wi_Description'),
